import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import { Button, Backdrop, AppBar, Box, Container } from '@material-ui/core';
import { withStyles, responsiveFontSizes } from '@material-ui/core/styles';
import GridRow from './gridRow';


const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 2,
    color: 'black',
    fontSize: '25px',
    width: '70%',
    maxWidth: '70%',
    marginTop: '20px',
    direction: 'flex',
    justify: "space-around",
    alignItems: "center",
    overflow: 'hidden'
  },
  paper: {
    padding: theme.spacing(12),
    textAlign: 'center',
    color: theme.palette.text.default,
  },
}));

export default function AutoGrid() {
  const classes = useStyles();

  return (
    <div className={classes.root}>  
       <Grid container spacing={10}>
          <Grid item sm={12}>
            <paper style={{fontSize: '45px', textAlign: 'center'}}>Shop</paper>
          </Grid> 
          <Grid item sm={6}>
            <paper>
          <img src={"/static/teeshirt.jpeg"} width='450px' maxwidth='50%' height='auto' />
          </paper>
          </Grid>
          <Grid item sm={6}>
            <GridRow style={{paddingLeft: '25px', paddingBottom: ''}}/>
          </Grid>
        </Grid>
    </div>
);
}
